import React from "react";
import { css } from "@emotion/css";

import Header from "./components/Header";
import NewMusic from "./components/NewMusic";
function App() {
  return (
    <div
      className={css`
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
      `}
    >
      <Header />
      <NewMusic />
    </div>
  );
}

export default App;
